The Authorized Version, or King James Version, quickly became the standard for English-speaking Protestants. Its flowing language and prose rhythm has had a profound influence on the literature of the past 400 years. The King James Version present on the Bible Gateway matches the 1987 printing. The KJV is public domain in the United States.



